					function Flatten_CUMULATIVE() {

							}
							for(var i = 0; i < datas.length; ++i) {

									item[0] += datas[i][1]
									item[1] += datas[i][2]
									item[2] += datas[i][3]

						s += '</div>'
						var id = 1
